11FREUNDE
Inhalt: Die 11FREUNDE-App infor­miert dich täg­lich über die Dinge, die auf und abseits des Platzes pas­sieren. Hier fin­dest du Geschichten vom Asche­platz um die Ecke und von der glit­zernden Fuß­ball­welt der euro­päi­schen Top­ligen. Hier liest du Inter­views mit Legenden und sol­chen, die es werden wollen. Hier ver­folgst du den 11FREUNDE-Live­ti­cker, der in Echt­zeit von den Spielen der Bun­des­liga, Cham­pions League und der Natio­nal­mann­schaft berichtet.&nbsp;
